declare enum HttpStatusType {
    Info = 1,
    Success = 2,
    Redirect = 3,
    ClientError = 4,
    ServerError = 5
}
/**
 * http通用类
 */
declare class HttpUtil {
    /**
     * 基于http状态码返回状态类型
     * @param httpResponseSatus http请求返回状态码
     * @returns null | HttpStatusType
     */
    static getHttpStatusType(httpResponseSatus: number): any;
}
export { HttpUtil, HttpStatusType };
